(18, 'laptop bag 7.JPG', 'Laptop Bag', '10.99', '24.49', '', '100', 'Black', 'Small: 10", 11", 12" & 13" / Medium: 13", 14" & 15', '', 'This bags offers comfort and protection for your treasured laptop and keep your documents/files in place and organized.', 'Double zipped laptop compartment, Steel framed and padded for structure, Double zipped back compartment, Shock absorbent, Elasticated retainers, Inner organizer section with pen holders, Stitched piped edging, Outer Velcro deep pouch, Padded handle and rubber grip shoulder strap \r\n- attached to the main bag by riveted washers \r\n- secured to the bags metal mainframe', '', '', '', 'business(bbags)', 'bbags', 4),
(19, 'nobis_garment_bag.jpg', 'NOBIS Suit Bag', '5.99', '12.79', '', '200', 'Black', '52" Long 29" Wide', '', 'Designed to protect your clothes while travelling. Also good to use for a tidy and organized wardrobe and to protect your garments against dust, dirt, creases and smell. Non-toxic and Harmless, Lightweight, Breathable, Dustproof, Reusable\r\nPlastic protector for hanger opening (Can be easily hang from wardrobe or car) Expandable Gussets to hold bulky or multiple garments. Fully breathable zipped garment cover to secure the carrier once it has been folded for carrying. Protective and acid free making it suitable for short or longer term storage\r\nAlso perfect for Wedding Dresses, Gowns and Prom Dresses', 'Plastic protector for hanger opening, 2x handles, Heavy duty & easy to wipe clean material, With front zip, Light weight, Folding storage or travel bag', '', '', '', 'business(bbags)', 'bbags', 6),
(20, 'main-18.jpg', 'Self-Adhesive Blank Address Labels', '1.49', '3.29', '', '250', 'White', 'A4 Sheet approx. 63mm x 47mm', '18 Labels per A4 Sheet', 'These address labels are perfect for shipping your parcels\r\nwith a professional finish. Perfect for envelopes, file folders and many other labelling tasks. These are also great as holiday gift tags or for labelling toys and other items. Can also be used as a reward stickers for students! Top quality white self-adhesive labels, suitable for Inkjet & LaserJet Printers\r\n(can be used in a wide range of printers and copiers), Handwriting, Layouts compatible with all leading software packages.', 'Top quality white self-adhesive labels, suitable for Inkjet & LaserJet Printers (can be used in a wide range of printers and copiers), Handwriting, Layouts compatible with all leading software packages', '', '', '', 'business(bmaterials)', 'bmaterials', 0),
(21, 'tripod_stands.jpg', '1M Universal Tripod Stand with Carry & Storage Bag', '8.99', '14.28', '', '500', 'Silver', '1M', '', 'Their aluminium lightweight leg with rubber grip allows maintaining a fixed grip on the ground while you create a good quality images and video. With the use of tripod you can achieve a great image and deliver performance quality. Get in your own photos & be a part of the memories by using self-timer on your camera! A tripod holds the camera steady enough to unlock all the performance potential the equipment you invested in is capable of.', '1 meter tall, Light Weight, Aluminium, Non-slip feet\r\nWith storage/carry bag, 3 way, 360 degree swivel pan head, Support video cameras, Quick-Release Leg Locks, Bubble level indicator', '', '', '', 'business(bmaterials)', 'bmaterials', 0),
(22, 'paper_shredder.jpg', 'Portable Paper Shredder', '11.99', '18.66', '', '100', 'Blue', '', 'Mini Portable', 'Small enough for the most modest brief-case and certainly small enough for the draw of any desk, business people on-the-move and even grandparents at home now have no excuses to leave confidential material around for others to use and abuse.\r\n\r\nINSTRUCTION:\r\n-Dump the crumble in the box in time.\r\n-Clean the machine using only soft cloth with a little detergent and water\r\n-Dont fill over weight paper, clippers, or nails in paper inlet\r\n-Dont open the machine, change the structure, or repair it without permission\r\n  \r\nWARNING:\r\nNEVER insert hands or fingers into paper entry as\r\nserious personal injury may result.\r\n NOT A TOY. Keep children and\r\npets away from shredder AT ALL TIMES as serious\r\ninjury may result.\r\n \r\nHOW TO USE:\r\nSimply insert the pieces of paper to the inlet, \r\nand start operating it using your hands', 'Shreds paper into 3 mm wide strips, Width of paper inlet: 123mm, Dimension after destroyed: 3mm(strip), Fit for office, school, or family use, For destroy office file and family document, It does not need battery or power so it can be used anywhere', '', '', '', 'business(bmaterials)', 'bmaterials', 0),
(23, 'car_silver_strips (3).jpg', 'Car Silver Strip', '15.79', '22.29', '', '67', 'Silver', '15m X 25mm', '', 'Customize the look of your car and make it stand out! This car silver strip will transform the exterior look of your car! A great protection for your door edges as well as for decoration purposes. With self-adhesive tape, can be used on both interior or exterior areas of your vehicle, made of flexible and durable high quality plastic material, abs + electroplating chrome,  the installation and removal of the trim is quick and easy, great for car decoration.', 'With self-adhesive , can be used on both interior or exterior areas of your vehicle, Made of flexible and durable high quality plastic material, Abs + electroplating chrome, The installation and removal of the trim is quick and easy, Great for car decoration ', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(25, 'car_cigar_lighter (3).jpg', 'Cigarette Lighter Socket Replacement', '3.79', '5.14', '', '657', '', 'Lighter diamerter: 20mm, Socket inside diameter: 2', '', 'Handy to buy and keep as a spare. Classic style and design. Fits standard 12V car socket units. Pop out system for safety. Wire fitting included. Easy to install or replace old one.\r\nCharger Socket unit for: Phone, Laptop, Notebook, Sat Nav. Perfect for those long road trips!', 'Fits most Makes & Models with 12V Circuit, Wire fitting included, Easy to install or replace old one', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(26, 'car_seat_cover.jpg', 'Universal Waterproof Car Seat Protector Blanket Cover', '7.49', '12.79', '', '98', 'Green', '44" x 52"', '', 'Perfect for protecting your upholstery and keeping your seats in good condition. Ideal use when you are travelling with your pet in the car or when you keep them at home alone. Soft and comfortable, clean seats for children, friends and yourself. Universal fit for all rear/back car seats, can be also used as cover for sofa protection cover at home. Made from durable waterproof fabric it will give years of protection.', 'Soft and comfortable, Universal fit for all rear/back car seats, Can be also used as cover for sofa protection cover at home, Made from durable waterproof fabric it will give years of protection, Machine washable, Easy to detach and rolls up neatly so it is ideal for storing in your car boot', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(28, 'car_windows_blinds.jpg', 'Car Window Sunshades Blinds', '5.99', '9.45', '', '90', 'Yellow, Yellow with Black, Grey with Black', 'Approx. 450 x 360mm', 'Snoopy Print', 'These pack consists of two Snoopy sunshades that are ideal to keep the sun off your little ones whilst travelling in the car and will also help to keep your vehicle cool. Protect your children from the sun in the car and also from UV rays. Suitable for all cars, keep your baby out of direct sunlight, lightweight polyester material with colourful print. Easy to fit with 4 suction cups.', '2 Window blinds per pack, 2 Suction cups with each window blinds, Lightweight polyester material with colourful print, Easy to fit with 4 suction cups', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(29, 'steering_wheel_lock.jpg', 'Steering Wheel Lock', '9.49', '15.42', '', '87', 'Orange', 'Length: Approx. 427mm (16.81"), Diameter: 38mm (1.', 'Baseball Bat', 'This strong steering wheel lock will fit most conventional car steering wheels and offers excellent protection against theft and break ins. Made from tempered steel construction. It is very simple to attach and comes complete with 2 unique security keys.', 'Strong and durable, Simple & easy to install, Hi visibility deters thieves, Steering wheels with air bags, Locks & unlocks in seconds, Vinyl coated to protect interior, Compact for easy storage, Key design is almost impossible to duplicate, Lock tumbler are virtually pick-proof , Disables steering wheel from rotating, 519g', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(35, 'blind_spot_mirror.jpg', 'Blind Spot Mirror', '5.99', '17.30', '', '874', 'Black', '11.5cm x 5.8cm x 3cm', '', 'Quality blind spot mirror perfect for road safety, especially on the motorway. They eliminates all blind spots as they provide a wide-angle view of what is behind and to the side of the driver, especially bikers that conventional mirrors alone can not see. The auxiliary mirrors assure safer travel with their wide convex lenses. Can be installed on top or bottom of your conventional side mirrors.', 'Easy to install and significantly enhance safety, Adjusted from conventional side mirrors, Convex wider view lens, Adjustable: Up or Down, Left or Right', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 2),
(36, 'car_airvalve_caps.jpg', 'Car Valve Caps', '1.99', '3.29', '', '432', 'Red, Silver', '1.7cm Height x 1cm Width', '', 'Caps fit all types of vehicle as rubber car valves are not dependent on vehicle make or model. If youre looking for a present for the petrol-head in your life, this set of 4 tyre valve caps are perfect! Instantly add a touch of personalisation to your car/van/bike! With realistic detailing and easy screw on installation they are an inexpensive addition to the styling of any car. The set is nicely packaged and would make a lovely gift for any car owner. Can be tightened with screwdriver for security purposes.', 'Standard fitting, High quality aluminium black valve caps, Easy to screw on, Rust proof, Solid metal', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(37, 'rearview_mirror.jpg', 'Car Rear Mirror', '5.49', '7.57', '', '426', 'Black', '27cm Length', '', 'Increase your safety by delivering a wider range of view. This flat wide rear view mirror has a silver anti-glare tint on the surface. To eliminate blind spots, increases visibility, and enhances safety while driving. Reduces the need to turn your head to look at your side mirrors. And clearly shows more of the area around your car. Ideal for all driving instructors and also great for keeping an eye on the kids in the back.', 'Real glass, High quality rear mirror, Can increase visibility up to 300%, Quick & easy to install, Standard fitting  will fit most vehicles, Wider standard mirror to give a better view, Polished to give a better reflection / visibility', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(39, 'bike_tool_kit.jpg', 'Bike Repair Kit', '2.79', '5.12', '', '432', '', '', '', 'This Tool-kit provides all the tools you could need for bike repair. A must have item for all bike riders. The kit includes the most common tools needed for many basic adjustments and repairs of your simple and advanced bike at home or on the road. It can fix most problems of your bike with this kit. It is suitable for everyone because of its low cost, from regular maintainers to occasional repairers, so you can all keep your bike in great condition. This can help you avoid expensive maintenance and repair fees giving you everything necessary to do the maintenance and repair yourself. The kit includes:\r\nFive (5) patches of several sizes and shapes. Two (2) curved lever tools. One (1) glue tube (vulcanization rubber cement). One (1) rasp tool (sanding tool). Two (2) rubber tubes. One (1) wrench tool.', 'Bike repair tools kit, Full function, easy to operate and durable to use, Contains everything you need to get your bike on the move again, Ideal for repairs to tyres, brakes, lights & chains', '1. Rough the area around the puncture with the grater (provided), 2. Cover an area around the hole, slightly wider than the patch, with glue., 3. Leave until the glue gets tacky ( approx. 2-5 minutes), 4. Centre a patch over the puncture, 5. Smooth out with thumb or a wooden spoon and make sure there are no air bubbles under the patch., 6. Leave to dry for about 15 minutes before replacing the inner tube in the tyre', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(40, 'car_window_scraper (1).jpg', 'Windows Scraper', '7.99', '9.52', '', '634', 'Black', '', '', 'Remove bugs and debris from car windshields and headlights with this professional, long-lasting squeegee; also use for window cleaning. Squeegee is comprised of a rubber blade that glides along the surface, creating a seal which prevents fluid from seeping underneath. A plastic frame secures the blade in place, and serves as a connecting point for the solid plastic, threaded handle. Bug Squeegee with 16" Handle includes an 8" nylon net covered sponge opposite the rubber squeegee, allowing the user to scrub and wipe glass surfaces clean. Makes cleaning faster and easier. Has a rubber blade squeegee. With the help of it you can easily clean windows and hard to reach places. Can also be used around the home to clean windows decking or other large areas.', 'Window Washer Squeegee, Easy grip, Lightweight & detachable handle, Can be stored easily with the hook in the handle, Sponge foam washer comes with nylon honeycomb webbing, Handle comes with hanging hook for easy storage', '', '', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(41, 'steel_tow_rope.jpg', 'Heavy Duty Steel Tow Rope', '8.49', '15.77', '', '653', 'Blue', 'Cable Length of 4m (with Hook)', '', 'The steel rope is a great item to have in your vehicle in case of an emergency.', 'Hooks with locking tabs on each end, Steel cable is covered in easy to clean plastic, Cover gives protection against Weather, rubbing etc., 2x Heavy duty forged steel hooks for easy on/off operation, It is high quality and the tabs prevent disconnection while in use towing, Can be used to tow cars, buses and trucks (Based on Weights Specification). It has great strength, hard wearing and easy to use., The forged hooks are specially designed for towing application use.', '', '1. Never use it on heavier vehicles than to specified, 2. Do not use it on rough surface, 3. Do not use repaired tow rope, 4. Tow the rope slowly, do not tow it suddenly, 5. Check the rope regularly to assure its function, 6. Use common sense when attaching to vehicles', '', 'vehicles(vaccessories)', 'vaccessories', 0),
(42, 'eva_mats.jpg', 'Extra Thick EVA Foam Yoga Mat', '15.99', '23.47', '', '400', 'Purple, Blue, Dark Grey', '', '', '15mm & 18mm extra thick EVA foam yoga mat. EVA foam sheet is made up of Ethylene Vinyl Acetate. It is a polymer that approaches elastomeric materials in softness and flexibility that provide comfort through workouts. The material has a good clarity, eco-friendly that suitable for: Sound proofing, Bed rolls, Exercise mat. It is Ideal for childrens arts and crafts, group activities and school projects. This EVA foam mat contained two elastic ties.', 'Contained two elastic ties, Multi-purpose, Eco-friendly, Compact and Lightweight, Waterproof and Soundproof, Elastic and Flexibility, No smell, No-toxic, Grease and Oil Resistant, Clean Easily with a Damp Cloth, Design to Reduce Impact and Provide Body Support, Thickness: 15mm & 18mm', '', '', '', 'fitness', 'fequipments', 6),
(43, 'belly-burner.jpg', 'Neoprene Fat Burner Slimming Belt', '15.99', '19.36', '', '100', 'Black', 'One Size Fits All', '', 'The stretchy neoprene material is great for heat retention, elasticity and comfort. Enhances weight loss help reduce waist line and cellulite build up reduces hypodermic fat and bulging tummy therapeutic heat for lower back muscles tightens and strengthens stomach muscles. Helps shed excess water as you exercise (sauna action).', 'Neoprene with Velcro Fastening', 'Simply wrap this belly fat burner belt around your tummy and start losing inches!', '', '', 'fitness', 'fequipments', 0),
(44, 'hand gripper.JPG', 'Hand Gripper', '1.79', '3.29', '', '200', 'Yellow, Blue, Black', '', '', 'A good grip is vital for any sport and these hand gripper is perfect for athletes or someone who is sport enthusiast! Ideal for developing strength, even possible to isolate fingers for additional strength training. Will develop gripping strength as well as forearm and wrist strengthening.', 'Heavy duty durable Steel springs, Spring coil resistance, Foam Ergonomic Grip Handle Design', '', '', '', 'fitness', 'fequipments', 3),
(45, 'phone_holder.jpg', 'Jabra Running Arm Band', '4.99', '7.29', '', '300', 'Black', '', '', 'It is flexible design adjusts to the figure of your phone. The running sport arm band case is a perfect accessory for the active smartphone users, which provides you the versatility of carrying your phone in a variety of ways. You can run, ride, lift and more without missing a second of your favourite tunes. These durable, lightweight running arm band case keeps your mobile phone secured and protected. These armband will not bounce or slide down. The material is stretchy so could fit any phone.', 'Arm band holder, Stretchy material, Adjustable velcro straps, Fits arm up to 32cm', '', '', '', 'fitness', 'faccessories', 0),
(50, 'tank stand.jpg', 'Aquarium Stand with Shelf', '45.99', '129.99', '', '412', 'Black', '13.5" x 25" with Leg Splay at the Bottom of 18"', 'With Shelf, 100L Aquarium Capacity', '\r\nThis aquarium stand is bound to compliment an array of interior home decor and will be practical and look great in any home. ', 'Black metal steel frame with steel wire brace. Accommodated most 10.15 and 20 Gallon Aquariums and Terrariums. Easy Assembly  No Tools Required, Dimension: 13.5 inches x 25 inches, With leg splay at the bottom of 18 inches, Heavy duty fish tank board for exceptional quality, Sturdy, chunky design for peace of mind, has a shelf spaced at the bottom row to accommodate your equipment.', '', '', 'Maximum weight: 400lbs. (181.82kgs)', 'home(decorations)', 'decorations', 2),
(53, 'bird_feeder.jpg', 'Easy to Construct Bird Feeder/House', '7.99', '10.57', '', '321', 'Green and Orange', 'Dimension: approx. 14.5 x 14.5 x 20.5cm', '', 'Enjoy the pleasant sound of birds singing in your backyard and get closer to nature with this wooden bird feeder. This bird feeder, welcomes birds into your garden allowing them to have the potential to nest.', 'the potential to nest.\r\nFeeding area is detachable and easy to construct for simpler fixing, cleaning and filling, Ideal for attracting wide variety of birds to your garden, Wooden Construction, Perfect present to your nature loving friends', '', '', '', 'home(decorations)', 'decorations', 0),
(54, 'magnetic_letters.jpg', '58 Pieces Magnetic Letters', '14.99', '21.99', '', '312', 'Bright Colours', '', 'Bright Colours Linen Embossed', 'These 58 magnetic lowercase letters have been carefully and beautifully crafted to create a fun and exciting environment, and it is also a way for toddlers to learn about different letters as well as gaining. An understanding about alphabets. Children can practice spelling simple words and names and learn their ABC with this set of 58 lower case letters. It is a fun way of learning to spell and develop basic literacy skills.', '58 pieces, Full of bright colours, Helps in encouraging and promoting literacy skills, Magnetic so can be attached to household objects to encourage active play, Linen embossed keep safe box to protect and store pieces, 6cm average height of letter ', '', 'Not suitable for kids under 3.', '', 'home(decorations)', 'decorations', 2),
(56, '4_way.jpg', '4 Way Hose Splitter', '7.99', '12.99', '', '442', 'Orange', '', '', 'Converts a single water tap to 4 independently controllable water outlets. Allows water supply to be split into 4 fully adjustable flow rate and shut off outlets. Ideal to use anywhere in the garden by running a length of hose from the tap to the 4 way connector. This is an excellent product to use with one of your hose and hose reel sets, or some of your jet-like water fed brushes. Giving you the ability to use your power washer, sprinkler system and fill the kids paddling pool etc. all at the same time!', 'Impact Resistant Plastic Body, One Screw-Thread Adapter with 4 Male Tap Connectors, 4 Independently Controllable Outlets, Includes Shut off Valves, Swivel Coupling, Fits Standard 3/4" Threaded Outside Tap', '', '', '', 'home(garden_tools)', 'gmaterials', 0),
(57, '4x_hose_pipe.JPG', '4pc Hose Pipe Set', '3.49', '5.25', '', '532', 'Green', '', '', 'Make watering your garden a breeze this summer with this garden hose pipe starter set. This set will provide everything you need. The set includes:\r\n2 x 3/4" hose connectors, 1 x 3/4" and 1 x 1/2" tap adaptor / connector, 1 x spray nozzle which is adjustable from mist to powerful', 'Flexible Handling, Wall Mountable, Locking clip allows for continuous spraying, With all major brands of hose including Hozelock, Made from ABS plastic which is frost resistant, rust proof & shatter proof, Easy to store', '', '', '', 'home(homeware)', 'cleaning', 0),
(59, 'braided_hose.jpg', 'Stainless Steel Braided Tap Hose', '9.99, 14.99', '4.49', '', '412', '', '450mm Long,  6pcs(a), 10pcs(b) ', '', 'High quality stainless steel braided hoses. Chrome fittings on either end. Loose nut female ends with rubber washers connect to standard kitchen and basin pipework. Threaded male ends connect to the monobloc tap. Rubber inner tube. Suitable for drinking water, Sink & most Toilet Cisterns.', 'High quality stainless steel braided hose, Chrome fittings on either end, Rubber inner tube, Threaded male ends, Loose nut female ends with rubber washers.', '', '', '', 'home(homeware)', 'kitchen_tools', 3),
(60, 'drill_powered_pump.jpg', 'Drill Powered Pump', '7.99', '12.65', '', '521', 'Black', '', '', 'Great for quick water transfer, drainage, pool, ponds and spillage or emptying containers, puddles, or minor flood clean up. Fill pump and input hose with water to prime the system for suction prior to pumping. Ideal for draining garden, ponds, tanks and domestic heating systems. Suitable for most non-flammable & non acidic liquids only. Ingenious power tool accessory, life-saver when you need to move water. Compact and lightweight easy to carry!', 'Drill powered pump, Compact, lightweight drill powered pump, Ideally suited to emptying ponds, flooded rooms, fish tanks etc., Connects simply to a power drill, Two connectors included, Minimum of 1500 rpm for the drill', '', '', '', 'home(garden_tools)', 'garden_tools', 0),
(61, 'hanging_dryer (2).JPG', 'Laundry Hanging Dryer', '5.49', '8.99', '', '321', 'Blue, Green, Peach', '', '', 'The hanging clothes dryer with 20 pegs is ideal for use inside and outside your house. Perfect for drying socks, underwear and other small items. Hangs on large rotatable hook. Ideal for homes with Limited Space. Suitable for use when camping or on holiday overseas, can easily be fitted inside a suitcase.', '20 Peg, Made from plastic, It hangs on large hook, Hooks easily to washing lines, Durable plastic construction, Lightweight, Compact and Portable Design, Folding for Easy Storage', '', '', '', 'home(homeware)', 'cleaning', 0),
(62, 'memo_board (2).jpg', 'Multi-Functional Memo Board', '23.99', '29.92', '', '321', 'Blue', '', '', 'This multi-functional memo board is perfect for making notes and reminders for the family or housemates! Pin photos, tickets, notes, party dates and Venues. Leaves messages when you are out. Holds class timetable. Collects e-mails and telephones numbers. Holds loose coins that you may need. Frame made from solid wood. Compact fit for wall in bedroom, hall or kitchen.', 'Large cork board for pinning notes, recipes, photos, Write-on, wipe-off on this easy to clean white magnetic board, Deep pocket for cook books, menus or kitchen utensils, Three metal hooks for Keys and kitchen towels', '', '', '', 'home(homeware)', 'kitchen_tools', 0),
(63, 'magic_mop.jpg', '360 Degree Magic Mop Twister', '7.49', '8.89', '', '433', '', '', '', 'This brilliantly designed floor-mop makes mopping so effortless! A sample test confirmed the absolute genius of this design! Built-in easy wringing twist system: The mop is primed for mopping with no excess water. Spot scourer: for gentle, effective cleaning of stubborn areas.360 degree rotating microfibre mop head. Super absorbent - makes short work of spills gentle cleaning for all surfaces for wet or dry use. Extendible stainless steel pole: Pole-hook for practical storage 51" fully extended & 31" closed.', 'Built-in easy wringing twist system: The mop is primed for mopping with no excess water, Spot scourer: for gentle, effective cleaning of stubborn areas, 360 degree rotating microfibre mop head, Super absorbent - makes short work of spills gentle cleaning for all surfaces for wet or dry use, Extendible stainless steel pole: Pole-hook for practical storage 51" fully extended & 31" closed.', '', '', '', 'homeandgarden', 'household', 2),
(64, 'mop_head.png', '2x Replacement Mop Heads', '5.49', '7.29', '', '112', 'Purple', '', '', 'This pack consist of 2 mop head replacements. Absorbent and durable material great for general floor mopping and cleaning. Zip tie included on top for fastening. ', 'Microfibre mop heads, Absorbent and durable material, Zip tie included on top for fastening', '', '', 'Can be machine or hand wash.', 'home(homeware)', 'cleaning', 1),
(65, 'DSC_5953.jpg', 'Smart Stitch Portable Sewing Machine', '27.49', '35.16', '', '341', 'White', '', '', 'Tailor your own designer fashion and household fabric accessories. A Smart Stitch Sewing Machine provides double thread sewing which makes firm stitching. It is a real sewing machine. Its so small that you can bring it anywhere to tailor and sew your own fabric accessories. Also great for mending and repairing. Ideal for beginners, home, dorm, office, travel and in any place you need it. Light weight, compact and portable. ', 'Easy to use, Powerful motor works perfectly from light materials like silk or lace to thick and heavy denim jeans, Even leather and plastic sheets, So small you can bring it anywhere or store in a drawer, Battery operated, AC/DC operations. Requires 4 AA batteries or AC adapter.', '', '', '', 'home(homeware)', 'appliance', 6),
(66, 'DSC_5927.JPG', 'HomEase Portable Sewing Machine', '23.99', '27.49', '', '431', 'White', '22cm x 22cm', '', 'HomEase is an amazing new portable mini sewing machine. It is so compact that you can hold it on the palm. So portable that it can be stored in a drawer. It allows you the facility of using treadle switch instead of hand switch so that you can sew with both the hands.', 'Very compact, lightweight, portable and ideal for all your sewing needs, Has built-in foot pedal, Ideal replacement for big and bulky machines, Superior double stitch technology, Comes with double speed, Works on 4 AA batteries / 6V Adapter (Not Included)', '', '', '', 'home(homeware)', 'appliance', 6),
(67, '4.jpg', 'Small World Mini Sewing Machine', '27.49', '29.99', '', '433', 'White', '', '', 'A mini sewing machine that really works! Crafts fit for the imagination! This Small World mini sewing machine allows anyone to design and sew the hottest runway styles, crafts and beautiful embroidery. Great starter machine for the beginner or craft enthusiast!', '12-Piece Set includes: Sewing Machine, 6 Bobbins, Needle Threader, 2 Needles, AC Adaptor and Foot Pedal, Requires 4-AA Batteries (Not Included)', '', '', '', 'home(homeware)', 'appliance', 3),
(68, 'light green.jpg', 'Telescopic Extendable Bathroom Shower Pole', '13.99', '15.49', '', '454', 'Light Green', '110 - 200m', '', 'Telescopic shower curtain pole rod is used for hanging curtain without drilling - not leaving any permanent marks on walls. Made from strong aluminium alloy. Comes with end caps to protect your wall / tile.', 'Easy installation, Made from strong aluminium alloy, Comes with end caps', '', '', '', 'home(decorations)', 'decorations', 0),
(69, 'franke_sink.JPG', 'Kitchen Sink Basin Drainer', '14.99', '17.99', '', '431', 'Silver', '', '', 'No more blocked sink, bath or basin! This is a replacement basket plug with the Basket Strainer and includes under-sink Waste Fitting unit. (For FRANKE Sink or others sinks with big Waste Opening) The stoppers are designed with a knob for easy pull out, practical and useful.', 'Diameter: 83mm, Material: Stainless Steel and Quality Injection Moulding, Prevent blockages, Simple to use and clean', 'Simply place in your plug hole, for example in your bath or shower and these little device will catch dirt and hair and stop it going down the plug hole.', '', '', 'home(homeware)', 'kitchen_tools', 3),
(70, 'velcro_hoop&look.png', 'Velcro Hook and Loop', '1.29, 3.29, 4.99, 8.', '2.99(a), 4.99(b), 7.', '', '423', 'Black', '1m, 3m, 5m, 10m', '', 'Black heavy duty hook and loop tape. Ideal for all types of arts and crafts projects. Long lasting can be reused.', '25mm Width, 100% Nylon, Eco-friendly, Elastic, Heat Resistance', ' 1. Ensure application surface is clean, dry and free from grease and dust, 2. Cut to size using a simple pair of scissors., 3. Use a sewing machine to secure firmly in place.', '', 'Machine washable', 'home(decorations)', 'decorations', 0),
(72, 'light brown.jpg', 'Velvet Hangers', '5.99, 14.49, 24.99', '6.25(a), 17.99(b), 2', '10x(a), 25x(b), 50x(c)', '111', 'Beige, Brown, Pink', '', '', 'Flocking velvety surface to prevent the clothes from slipping down and protecting the delicate fabrics. Lightweight and ultrathin design to save wardrobe space. The hook is made of stainless steel material. Integrated trousers bar and small hook design on sides for hanging clothes with straps. The hangers are ideal for all kinds of items of clothing curved corners allow clothes to keep their shape.', 'Lightweight and ultrathin design, Hook is made of stainless steel material, Curved corners, Slim soft and durable', '', '', '', 'home(homeware)', 'cleaning', 0),
(73, 'airer (1).jpg', 'Adjustable Cantilever Garden Parasol', '74.99', '129.00', '', '644', 'Green', '', '', 'Unique cantilever design gets traditional umbrella pole out of way! Ideal for outdoor use - garden party, beach, picnic, camping... When not in use = wind it up using. Easy-to-use hand crank to store away till you use it next time.', 'Parasol can be rotated to provide the best shade from the sun, Different locking mechanisms, Heavy duty powder coated steel frame, Sturdy steel ribs supporting canopy, Stylish scallop skirting detail canopy made with an air-vent, Surprisingly light-weight and compact when the parasol is folded away, Hand crank to wind down parasol for storage', '', '', '', 'home(decorations)', 'decorations', 0),
(74, 'dish_drainer.jpg', '2-Layer Dish Drainer', '12.49', '39.99', '', '321', 'Silver', '', '', 'The top tier is designed to hold plates, bowls and dishes while the bottom can be used to dry utensils and glasses. On one side of the drainer there is a part to place cutlery and on the other holders to place mugs. The drainer also includes a removable plastic drip tray meaning you can place it on any work surface in the kitchen. The drainer is made from durable chrome plated steel. Perfect item for any home, hotel, office.', 'Made from High Durable Stainless Steel, Easy to Assemble, Elegant and Space Saving, Stylish for Modern Kitchens, Space for plates, bowls, dishes, utensils, glasses, cutlery and mugs, Easy to clean. Just wipe down with a damp cloth!, 16" wide x 12" deep x 12" high', '', '', '', 'home(homeware)', 'kitchen_tools', 1),
(75, 'hot_plate (2).jpg', 'Portable Electric Hot Plate', '13.99', '17.10', '', '222', 'White', '', 'Single Hot Plate', 'This Hot Plate is an electric hob that is perfect for those who cook rarely and for those have limited spaces especially those renting an apartment. It can be used as a kitchen equipment for gardens, camping spots, parks, and more.', 'Easy to clean and durable, Space Saving solution, Can be used to replace an oven, Can be used to warm the food, Non-slip feet', '', '', '', 'home(homeware)', 'appliance', 0),
(76, 'DSC_5227.jpg', 'Weight Watchers Measured Serving Spoons', '10.79', '12.99', '', '321', 'Chrome', '', '1 Cup, 1/2 Cup, 1/4 Cup', 'These brushed stainless steel measuring spoons wont break or fade like plastic ones. These spoons make measuring food very easy. The wide open design makes it easier to portion out your food. They are sturdy and lightweight, not as heavy as some of other serving utensils. Great way how to keep track of your portions.', 'High grade stainless steel, easy to clean: dishwasher safe, Sizes: 1 cup,  cup &  cup, Sturdy & lightweight', '', '', '', 'home(homeware)', 'kitchen_tools', 6),
(77, 'DSC00085.JPG', '7 TPI Hand Wood Saw', '8.49', '13.65', '', '422', 'Silver', '', '7 Teeth', 'Manufactured to our specifications by one of Germanys oldest saw makers. This saw offers great performance at a reasonable price. Made from German steel blade with diamond sharpened and precision set teeth. The teeth have been impulse hardened meaning they will stay sharp vastly longer than regular saws. This saw cuts on the both push & pull stroke and it is fitted with wood material. Handle which is screwed for comfort and security.', 'General purpose hard point saw, Comfortable and durable, Cuts both push & pull stroke, 7 cross ground teeth per inch (7 tpi), Cuts quickly & accurately, Hardened and tempered steel blade for strength, Blade length approx. 550mm (22)', '', 'Keep out of reach of children.', '', 'home(homeware)', 'hand_tools', 5),
(78, 'grinder_set.jpg', '105 Piece Grinder/Polisher Attachment Set', '7.99', '9.69', '', '323', '', '', '', 'An excellent comprehensive attachment set for hand-held rotary polishers and grinders. Perfect tool for stone polishing, jewellery making and cleaning or carving + sanding of small items.', 'For use on craftsman rotary tools that accept 1/8-in shanked accessories, Total of 105 pieces, The set includes: 36x 23.8mm cut-off wheels, 36x medium-gpit 3/4in sanding discs, 3x 31.8mm reinforced cut-off wheels, 1x 12.7mm drum sander, 5x 12.7mm fine-grit sanding bands, 4x 12.7mm coarse-grit sanding bands, 2x 3.2mm high-speed cutters, 1x 25.4mm felt polishing wheel, 6x 12.7mm felt polishing wheels, 1x 9.5mm felt polishing tip, 1x 19mm wire wheels brush, 1x 12.7mm bristle cup brush, 1x 9.5mm x 25.4mm dressing stone, 1x polishing compound, 1x 9.5mm & 1x 15.8mm aluminum oxide grinding stone, 1x 10.3mm & 1x 19.8mm silicon carbide grinding stone, 1x 3.2mm set screw mandel, 1x 3.2mm screw mandrel', 'Wear goggles and gloves when using.', '', '', 'home(homeware)', 'hand_tools', 0),
(79, 'ladybug.JPG', 'Cute Umbrella', '6.49', '12.61', '', '333', 'Red Ladybug, Yellow Duck', '', '', 'What a lovely gift for a small girl, little ladies love to parade around and be "just like mum" and with this lovely childrens umbrella they can stay dry on a rainy day too!', 'Great quality, Light weight, Waterproof and Easy to use, Super bright canopy, Has a spring action open-closhing mechanism, Handles are smooth, safe and easy grip handle for little hands, Easy wipe clean material', '', '', '', 'kids(kaccessories)', 'fashion', 4),
(80, 'princesses.JPG', 'Pink Princess Backpack', '8.99', '10.50', '', '222', 'Red Pooh, Blue Pooh, Blue Snoopy, Red Fashion Life, Pink Princesses, Pink Mickey Minnie Mouse', '', '', 'Three Princess characters are featured on front pocket. Stunning, Lovely and Cute girls bright colour design backpack. Ideal for nursery, school, lunch, sport, PE, ballet, dance, camping and more...', 'Padded adjustable shoulder, Straps and carry handle on top, Made from strong pink canvas material, 3 stepped compartments with zipped closures, 2 Mesh pockets on each side, 300mm height 250mm width 150mm depth', '', '', '', 'kids(kbags)', 'educationalbag', 3),
(81, 'DSC_5668.JPG', 'Color Kids', '11.99', '16.99', '', '331', 'Pink, Blue', '1 year EU 86 / 92 3 year EU 98 / 104 5 year EU 110', 'Stripes', 'Suit your kids with this protective waterproof raincoat jacket and their outdoor time wont be cut short due to dropping temps. Very cute, handy and a must for the wet weather at the moment. Comes diagonal zip with button release storm flap \r\n& elasticated wrist fastening. Ideal for school, outdoor activities, camping and more.', '100% PU with 100% Polyester lining, Press stud buttons at front with full length zip, Waterproof and windproof, Hi-Visibility strips for road safety, Removable hood with clip on button fitting, 2x Spacious side pockets, Elasticated wrist hem and the bottom of the jacket, Washing machine washable', '', '', '', 'kids(kclothes)', 'hi-vis', 4),
(82, 'DSC_5690.JPG', 'Jako-o Rain Coat', '11.49', '19.99', '', '122', 'Red & Navy, Blue & Orange', '1  2 years EU 80 / 86', '', 'Little boys and girls dont have to feel sad when it rains now! The waterproof raincoat will keep your little ones safe, dry and smiling in the rain.', '100% PU with 100% Polyester lining, High Visibility Strips for Safety, Press stud buttons at front with full length zip, Fleeced collar and cuffs for comfort and warmth, Waterproof and Windproof Hi-Vis jacket, Mesh ventilated hood with concealed adjustable fitting, 2x Spacious deep pockets with velcro closing, Adjustable wrist velcro fastening, Elasticated hem on the bottom of the jacket', '', '', ' Washing machine washable', 'kids(kclothes)', 'hi-vis', 4),
(83, 'red.jpg', 'Arts and Crafts Kids Apron', '3.59', '5.79', '', '421', 'Red, Blue, Yellow', 'For 2-3 years old 58cm, For 3-4 years old 58cm, Fo', '', 'Give children safe inspiring and creative environment. These aprons are practical presents for kids,\r\na great way to engage them in the kitchen. Best for painting and school projects! Can also be used for drawing, painting, gluing, cutting, baking, cooking, washing and more.', 'Waterproof flexible fabric, Polyurethane coated strong material, Strap belt has velcro endings for easy putting on & off, Strap belt fastens around waist over the apron holding it in place', '', '', 'Simply wipe down clean or hand wash', 'kids(kclothes)', 'fashion', 0),
(84, 'DSC_4350.jpg', 'BMS Hooded Jacket', '9.99', '17.69', '', '332', 'Navy Blue', 'For 12-18 months EU 80, For 18-24 months EU 86, Fo', '', 'One of the best ways to protect your children from the elements outside is giving them this waterproof hooded jacket. This BMS jacket has a 3M reflective stripes to keep your kids safe at night! The hood is for extra protection from rain, snow or wind. ', 'Welded 100% waterproof, All seams, Hooded, 3M reflective stripes, Full zip front and button fastener, Two side pockets, Elastic outer material', '', '', 'Washable at 30 C', 'kids(kclothes)', 'hi-vis', 5),
(85, 'DSC_5658.JPG', 'Glade Barn Raincoat Jacket with Visor Hood', '12.99', '17.59', '', '321', 'Navy Blue and Red', 'EU 98, EU 104, EU 116, EU 122, EU 128', '', 'Put this jacket over your kids clothes to keep it dry and clean, all day. Also, as protection against rain, wind or even sleet and snow when worn over warm layers. Perfect for everyday outdoor activities. Ideal use for school, camping, playing in the rain, wet days, or playing in snow and more!', 'PU coated 100% polyester, With visor hood, Storm flap, Reflective stripe, Elasticated wrist cuffs, Full-zip front closure and button fastener, Durable and lightweight', '', '', '', 'kids(kclothes)', 'hi-vis', 5),
(86, 'DSC_3800.jpg', 'Fun Cute Wooden Frog Penny Bank', '7.99', '8.99', '', '775', 'Green', '', 'Cute frog', 'This money bank makes saving fun and educational, and can help kids learn the ropes of financial responsibility. If you teach your kids how to handle their money, they will be financially responsible for a lifetime. This money bank has a slot on the top to insert the money. It has a stopper so you do not have to break it to get your money out, so it can be used again!', 'Cute wooden frog, Has a slot on the top, It also has a stopper', '', '', '', 'kids(ktoys)', 'kids', 2),
(87, '1.jpg', 'Toy Storage Box', '34.99', '39.99', '', '753', '', '400mm x 400mm', '', 'The seemingly impossible task of keeping your kids room clutter-free can often be stressful. Maximizing the space and storage in your childrens room is essential\r\nto maintaining organization and simple enough so that\r\nyour child knows where all his or her toys are, and where to put them away. Its important for every childs happiness that all toys be available and ready!', 'Sturdy designed to hold everything from toys to games or from books to clothes, With handles and wheels make moving the storage box easy and convenient, It also has lid to protect the belongings from getting dirty, Easy to keep clean, Multiple uses and practical storage solution, Cute colour combination with a cute panda design, Kids have full access', '', '', '', 'kids(ktoys)', 'outdoor', 2),
(89, 'sunglasses.JPG', 'Polarized Clip On Sunglasses', '4.99', '9.00', '', '423', 'Black', 'Small, Large', '', 'With this polarized clip on sunglasses one will be able to simply place on the shaded lens over their regular glasses and keep going. Clip on sunglasses are the perfect combination of function and style to meet the demands of an active person.', 'Polarized, Deep clip, Anti-glare, Lightweight', '', '', '', 'men(maccessories)', 'fashion', 0),
(90, '12-Pcs-of-Spectacle-Eyewear-Braided-Nylon-Neck-Cord-font-b-String-b-font-Retainer-Strap.jpg', 'Eyeglass Strap Holder', '0.99, 2.79, 4.99, 8', '1.49', '1 pc, 3 pc, 6 pc, 12 pc', '122', 'Black', '', '', 'The eyeglass cord is designed to keep the eyewear securely in place without missing. With this strap holder to keep your eyeglass safe around your neck. Perfect to keep your sunglasses in place everywhere you go! Suitable for optical frames, reading glasses, sunglasses.', 'Good toughness nylon material, Lightweight and durable, Very convenient, End loops securely fasten, Length: 30"', '', '', '', 'men(maccessories)', 'fashion', 0),
(91, '2.jpg', 'High Heel Gel Insoles', '8.99', '10.49', '', '332', '', 'UK 2 / EU 35 / US 4, UK 3 / EU 36 / US 5, UK 4 / E', '', 'These Honeycomb Gel Insoles features soft gel material 2-layered, detachable design heel lift pad height insoles. You can adjust the height by attach or detach removable insert.\r\ncan be used in different styles of shoes. Great for all sufferers of arthritis, gout, heel spurs, calluses or anyone recovering from a sports or work injury.', 'Increase your height up to 2", Adjustable 2 layer system, Soft and comfortable cushions, Detachable design heel lift pad, Adjustable height, No deformation, no wear and tear, Can be used in different styles of shoes and boots, Cut easily to your size with line indicate at the front bottom of insoles', '', '', '', 'men(maccessories)', 'fashion', 0),
(92, 'brown1.jpg', 'Soft Fluffy Ear Muffs', '2.99', '5.99', '', '314', 'Brown, White, Red, Orange, Grey, Pink, Baby Pink, Light Blue', '', 'Plain padded fluffy faux fur', 'These ear muffs will keep you super warm on cold chilly winter days and nights. Their appearance with simple, but stylish and elegant design is a must have fashion accessory this winter. Great for a snowy stroll or a skate around the rink.', 'Made of warm and comfortable plush material, Lightweight and easy to carry', '', '', '', 'men(maccessories)', 'fashion', 0),
