(94, '22.jpg', 'Soft Knitted Thinsulated Gloves', '3.29', '8.45', '', '345', 'Grey, Grey with 2 White Strips, Grey with 2 Grey Strips, Grey with 2 Red Strips, Dark Blue', 'One Size Fits All', '', 'A quality traditional pair of warm knitted gloves with Thinsulate lining to keep you warm, comfortable and stylish.', 'Made from thinsulate lining, full finger gloves, knitted', '', '', '', 'men(maccessories)', 'fashion', 0),
(95, 'red_bracelet.jpg', 'Mosquito Repellent Bands', '1.79', '2.75', '', '645', 'Yellow, Red, Green, Blue, Black', '', '', '', 'Waterproof mosquito repellent band, Can be worn on wrist & ankle, Citronella oil extract is effective ingredient against mosquitoes, Adjustable level of fragrance release, High grade silicone material, 100% Natural non-toxic product - Deet Free, Can be attached near baby cots & buggies for protection, Wrist band lasts for 4-6 weeks with each hole lasting 5-7 days', '\r\nIn high mosquito dense areas puncture all 5 holes to ensure maximum protection lasting 1 week.', '', '', 'men(maccessories)', 'fashion', 0),
(98, '21-021-0785.jpg', 'Waterproof Jacket', '16.99', '23.99', '', '655', 'Violy Blue', 'M, L, XL', '', 'This jacket resists water and wind for all-day comfort. Use this jacket youre your clothes to keep it clean and dry. Perfect for rainy days. Suitable for all types of weather condition.', 'Sleeve protection, 2 pockets, Fully zipped, Polyester fill padding for warmth, Hi-viz for safety, This garment is suitable for transportation as supplied by the manufacturer', '', '', 'Always store in clean dry conditions, Do not keep in places subject to direct sunlight, Do not wash in biological powders, Wash as synthetics, Machine wash or hand wash', 'hivisworkwear', 'workwear', 4),
(99, 'DSC_5533.JPG', 'Dickies Hi Viz Jacket', '23.99', '29.70', '', '423', 'Yellow', 'XL', 'The rain clothing from Dickies has been design and manufactured to five the best possible blend of performance, strength and comfort in the workplace at a great affordable price.', '', 'Two high visibility strips around the body, 2 on each arm and one over each shoulder, With reflective vertical and horizontal stripes, 2 outer waist pockets with flaps, With Front full button closure, Taped seams for added protection', '', '', '', 'hivisworkwear', 'hi-vis', 4),
(100, 'DSC_5989.JPG', 'Hurricane Hi Visibility Waterproof Jacket', '19.29', '23.99', '', '532', 'Yellow', 'XL, 2XL', '', 'This high visibility jacket is extremely useful when you or your staff usually works in poor weather conditions. The reflective panels on this clothing can help to be seen through mist, rain or fog, or on construction sites or workers who complete tasks outdoors regardless of the weather. Perfect for use when roadwork is being done in an emergency at night time or in low light conditions.', 'Denier Woven 100% Polyester/PVC. 3M Scotchlite Reflective Tape, Taped seams for added Protection. Polyester padding & Nylon Quilted Lining, Heavy Duty 2 way zip with Press Stud Storm Flap, 1 inside Chest Pocket, 2 Outer Waist Pockets with Flaps, Front Full Button Closure, Concealed Hood', '', '', '', 'hivisworkwear', 'hi-vis', 0),
(101, 'DSC_5976.JPG', 'Labrador High Visibility Jacket', '27.99', '36.79', '', '342', 'Yellow', 'M, L, XL, 2XL', '', 'This high visibility jacket is extremely useful when you or your staff usually works in poor weather conditions. The reflective panels on this clothing can help to be seen through mist, rain or fog, or on construction sites or workers who complete tasks outdoors regardless of the weather. Perfect for use when roadwork is being done in an emergency at night time or in low light conditions.', 'Waterproof breathable and lightweight, Two high visibility strips around the body, 2 on each arm, Front pockets and 2 pocket inside, Front full zip closure', '', '', '', 'hivisworkwear', 'hi-vis', 4),
(102, 'DSC_5623.JPG', 'Mascot Hi Visibility Jacket', '22.99', '83.98', '', '523', 'Orange', 'XS, S, M, L, XL, 2XL', '', 'This high visibility jacket is extremely useful when you or your staff usually works in poor weather conditions. The reflective panels on this clothing can help to be seen through mist, rain or fog, or on construction sites or workers who complete tasks outdoors regardless of the weather. Perfect for use when roadwork is being done in an emergency at night time or in low light conditions.', '70% polyester/30% polyurethane, 210 g/m, Wind and water proof, Fluorescent with vertical & horizontal reflective tapes for safety, Hood w/ hidden drawstring in collar, Fastening w/ zip & storm flap w/ press studs, Chest pocket with flap & press stud, Front pockets w/ flap & press stud fastening, Ventilation in the back, Adjustable elastic drawstring at waist, Press stud fastening at cuffs', '', '', 'Always store in clean, Dry Conditions, Do Not Keep in places subject to direct sunlight, Do not wash in Biological powders, Wash as synthetics, Machine wash or hand wash, This garment is suitable for transportation as supplied by the manufacturer', 'hivisworkwear', 'hi-vis', 2);
