(103, 'orange.jpg', 'Pioneer Hi Visibility Vest', '19.99', '25.38', '', '342', 'Orange, Yellow', 'S, M, L, XL, 2XL, 3XL, 4XL', '', 'This surveyors vest has tons of features including radio phone pocket and clip straps, underarm mesh vents and back pouch with zipper access. Ideal for construction workers, runners, cyclists, drivers, security, workers, surveyors and more.', ' 150 denier woven twill polyester, CSA Z96-09 Class 2 Level 2, 3M Scotchlite reflective tape, Brass snap front closure, Radio phone pocket on chest and 2 radio phone clip straps, Cooling underarm mesh vents, Back ruler storage slot and large back pack pouch with zipper access, 4 front pockets with brass surveyor tape dispenser grommets, 5 pen pockets, 7 other all-purpose storage pockets and D ring access slot', '', '', '', 'hivisworkwear', 'hi-vis', 0),
(104, 'DSC_5539.JPG', 'Hi Visibility Vest', '8.19', '10.49', '', '342', 'Orange', 'M, L, XL', '', 'Easy to wear and take off, lightweight material, 3m high quality reflective banding. Providing effective recognition in the day and under poor light visibility at night, with its high visibility this vest is ideal for jogging, school patrol, cycling, driving, security, pedestrians, road work, general industry or any outdoor activity you want to be seen!', '3M Silver reflective stripes, Orange safety vest, Front Zip closure, Button Fastening on sides and shoulder part, Solid lightweight breathable material, Elasticated Waist at the back', '', '', '', 'hivisworkwear', 'hi-vis', 4),
(105, 'DSC_4692-a.jpg', 'Panoply PVC Waterproof Rain Jacket', '8.99', '12.49', '', '342', 'Navy Blue, Dark Green, Yellow', 'M, L, XL, 2XL', '', 'The rain clothing range from Panoply has been designed and manufactured to give the best possible blend of performance, strength and comfort in the workplace at a great affordable price.', 'Sewn and taped sealed seams, Hooded jacket with hood cord, Zip fastener, Wind-resistant flap inside, Raglan sleeves with press-studded cuffs, Air vents on armholes, Dorsal flap with ventilation, 2 flapped pockets', '', '', '', 'hivisworkwear', 'workwear', 5),
