(151, 'pennybank.jpg', 'Fun Cute Wooden Frog Penny Bank', '7.99', '10.00', '', '321', 'Green', '', '', 'How to manage money is often forgotten subject in most schools. Your kids only learn the basics, for ex: counting or identifying different coins but you, parents have to teach them the necessarily skills for money management. This money bank makes saving fun and educational, and can help kids learn the ropes of financial responsibility.', 'This money bank has a slot on the top to insert the money, It also has a stopper so you do not have to break it to get your money out, so it can be used again!', '', '', '', 'holidayandtravel', 'hgifts', 0),
