(155, 'trampolite_enclosure_net.jpg', 'Trampoline Safety Net Replacement', '19.49, 22.49,25.49,29.49', '22.00, 25.99', '', '312', 'Black', 'Fit 8 ft, Fit 10 ft, Fit 12 ft, Fit 14 ft', '6 poles(a), 8 poles(b)', 'Suitable for vast majority of round shaped materials. When you use a trampoline it should have a safety net. In this way you can practice jumping safely. Door with zip and safety clip entrance ensure that no one can fall off the trampoline. These trampoline safety nets have an approx. 1 ft. distance between the net and the poles. So it is safer than other nets as your kids can not bump into the poles and hurt themselves when jumping.', 'Fine weave design mesh, Top quality polyethylene, Door with zip and safety clip entrance, An approx. 1 ft distance between the net and the poles, Net is attached with straps', '', '', '', 'homeandgarden', 'garden', 0),
(156, 'trampoline_spring_covers.jpg', 'Universal Trampoline Spring Cover Replacement', '22.49, 30.99', '25.99, 36.70', '', '321', 'Blue', '10 ft, 14 ft', '', 'Get ready for holidays and summer months. Replace your safety pads if they are old, damaged, weathered down. Prevent injury by covering springs and spaces between them. Impact resistant with soft foam padding.', 'Prevent injury by covering springs and spaces, Impact resistant with soft foam padding', '', '', '', 'homeandgarden', 'garden', 0),
