(159, 'jabra_arm_phoneholder.jpg', 'Jabra Running Arm Band', '4.99', '7.29', '', '432', 'Black', '', '', 'It is flexible design adjusts to the figure of your phone. The running sport arm band case is a perfect accessory for the active Smartphone user, which provides you the versatility of carrying your phone in a variety of ways. You can run, ride, lift and more without missing a second of your favourite tunes.', 'Arm band holder, Stretchy material, Adjustable velcro straps, Fits arm up to 32cm, Compatible with: iphone, mobile phone, ipod', '', '', '', 'sports', 'saccessories', 3),
