(185, 'Bike Multi Tool Set Bicycle Cycling.jpg', 'Bike Multi Tool Set Bicycle Cycling Tyre Patches Puncture Maintenance Repair Kit', '1.79', '', '', '', '', '12pc Cycle Pump Rubber Lever', '', 'THIS BICYCLE REPAIR TOOL KIT CONTAINS ALL OF THE ITEMS THAT ARE ESSENTIAL \r\n\r\nFOR ON THE SPOT REPAIRS THAT WILL GET YOU BACK ON THE ROAD. ', 'THE KIT INCLUDES:\r\n> FIVE (5) PATCHES OF SEVERAL SIZES AND SHAPES <\r\n> TWO (2) CURVED LEVER TOOLS <\r\n> ONE (1) GLUE TUBE (VULCANIZATION RUBBER CEMENT) <\r\n> ONE (1) RASP TOOL (SANDING TOOL) <\r\n> TWO (2) RUBBER TUBES <\r\n> ONE (1) WRENCH TOOL <', '', '', 'INSTRUCTIONS: "HOW TO FIX PUNCTURED/FLAT BIKE TIRE"\r\n1. REMOVE THE FLAT TIRE FROM THE BIKE, BY REMOVING THE NUTS\r\n2. TAKE OUT THE FLATTED TUBE FROM THE TIRE, USING THE FLAT EDGES OF CURVED LEVER TOOLS \r\n3.ONCE THE TUBE IS OUT, USE A BICYCLE PUMP TO FILL THE TUBE UNTIL IT IS FIRM \r\n4.SCRAPE THE DAMAGED AREA OF THE TUBE WITH THE RASP TOOL TO CLEAN AND ROUGHEN THE SURFACE FOR THE PATCH \r\n5. APPLY SOME OF THE ADHESIVE, GLUE TUBE (VULCANIZATION RUBBER CEMENT), TO THE SCRAPED AREA OF THE TUBE \r\n6.SELE', 'toolsandfixing', 'tools', 1),
