(210, 'Wooden Bamboo Skewers Grilled Kebab BBQ Sticks Xmas New Year Party Wedding Event.jpg', 'Wooden Bamboo Skewers Grilled Kebab BBQ Sticks Xmas New Year Party Wedding Event', '0.99', '2.99', 'Quantity.: 80x pcs, 160x pcs, 240x pcs', '', '', '7inch long 190mm , 11inch long 290mm', '', 'High quality that will not swell or splinter like cheaper woods!\r\nIdeal to use when grilling this coming Christmas and New Year!\r\nGenuine bamboo barbecue skewers\r\nIdeal for BBQs and buffets, allows food to cook without setting alight or scorching\r\nSharp Point on one End\r\nGreat for holding pieces of food together \r\nwhile grilling or roasting meats and in other culinary applications\r\n', 'Bamboo skewers can be used with:\r\nChocolate Fountains\r\nFruits\r\nToasting Marshmallows\r\nKebabs\r\nCheese fondue\r\nBBQ\r\nSatay Skewers\r\nAnd other food that needs to be grilled', '', '', '', 'wedding&parties', 'accesories', 1),
(211, 'Playing Deck Cards Casino Plastic Coated Poker Games Adults Solitaire Miniature.jpg', 'Playing Deck Cards Casino Plastic Coated Poker Games Adults Solitaire Miniature', '3.49', '5.49', '', '', '', '', '', 'This game is perfect for yourfriends and family to play!\r\nNew 100% High Quality Plastic Poker Playing Cards\r\n Durability means they are very difficult to damage or mark in a game situation\r\nEssential for rainy afternoons, long journeys and family holidays these high-quality playing cards are plastic coated. One 54-card deck is provided per order. Perfect for all of your favourite card games - from snap to solitaire and trumps to rummy - the hours will fly \r\nMaking your game more enjoyable and hassle free!', '', '', '', '', 'wedding&parties', 'accessories', 2),
(212, 'Playing Cards Family Friends Deck Play Kids Adult Pack Set Game Box Index Party.jpg', 'Playing Cards Family Friends Deck Play Kids Adult Pack Set Game Box Index Party', '3.99', '8.39', '', '', '', '', 'A family-friendly\r\ncard game, UNO offers hours of fun.\r\nIt''s easy to learn, always unpredictable, and never dull.\r\nIt can be played with 2 to 10 players, individually, or in teams.\r\nInstead of using the four colors, you use the suit (Spades, hearts, clubs, diamonds)\r\nNumbers 2-9 are just like UNO except 1 and 0.', '\r\nThe suit cards are the action cards. And it can even be educational,\r\nteaching younger kids number recognition. For more than\r\n40 years, Uno has been a card game that just about\r\neveryone in the family can play.', ' UNO is one of the world''s most popular family card games\r\nEasy to learn, fast and fun to play\r\nFor Ages 7 +\r\n2-10 players', 'How to play:\r\nGet rid of all your cards before everyone else.\r\nMatch the number, colour, or type of card to play;\r\nuse a wild if you don''t have a match, or draw from the\r\npile until you get a card you can play.', '', '', 'wedding&parties', 'accessories', 2),
