(215, 'Bio Crystal Magic Gel Soil Jelly Water Plant Flower Gift Pearl Bead Centerpiece.jpg', 'Bio Crystal Magic Gel Soil Jelly Water Plant Flower Gift Pearl Bead Centerpiece', '0.99', '3.99', '', '', ' orange, pink, red, green, purple, blue, white', '', 'Crystal soil acts as a reservoir to store and release \r\na steady stream of water and nutrients which plants need to grow \r\nand flower cuttings need to remain fresh for longer. \r\nCrystal soil bead that contains tiny holes (cannot be seen by bare eyes) \r\nthat hold air and and water droplets. \r\nGrow plants without the hassles of keeping dirt. \r\n', 'xtremely healthy for your plants and very elegant for your Home!\r\nThis Flower Soil Gel is available in different colours,\r\nso you can use one that best accents the colour scheme of your home\r\n\r\nJust imagine sitting there with a beautiful flower growing in a Flower soil gel\r\nwhile you eat with your family.\r\nyour living Space will look undeniably marvelous!..\r\nThe Most Popular way to use Flower Soil Gel \r\nis to plant your indoor plants \r\nright into the gel itself without soil.', 'Crystal soil acts as a reservoir to store and release \r\na steady stream of water and nutrients which plants need to grow \r\nand flower cuttings need to remain fresh for longer. \r\nCrystal soil bead that contains tiny holes (cannot be seen by bare eyes) \r\nthat hold air and and water droplets. \r\nGrow plants without the hassles of keeping dirt. ', 'Instructions: \r\n1. Put one package of Crystal-soil into 1/2 liter of clean water. Soak the Crystal-soil in the water for 8-12hours. Then lightly rinse with clean water. Drain excess water. \r\n2. When using for planting, rinse dirt off roots of plant and cut off decayed roots and leaves. \r\n3. When using in flower arrangements, the flowers can be inserted directly into the vase of Crystal-soil. \r\n4. Every 15 days, rinse roots of plant with water to keep the plant and Crystal-soil clean. \r\n5. If the', '', '', 'weddin