(218, '10 X Bamboo Tiki Torch Lantern Garden Wedding Party Event Lighting Outdoor Lamps.jpg', '10 X Bamboo Tiki Torch Lantern Garden Wedding Party Event Lighting Outdoor Lamps', '42.99', '52.99', '', '', '', '5ft weave pathway patio natural', 'Hand crafted from a natural resource, \r\nthe bamboo is split and weaved to hold the\r\nlantern canister, making it very lightweight and strong. \r\nThe ground stake is grooved at the base for easy insertion.\r\n', 'A unique outdoor decorations\r\nfor home or outdoor use!\r\nBAMBOO TORCH\r\n100% Brand New!\r\nThese torches provide\r\nHeat, Light, Insect Repellent,\r\nand they are also well burnished bamboo\r\ntorch that is great looking as decoration on your pathways,\r\nbackyard or garden. Torch is a portable source of fire\r\nused as a source of light, a piece of wood\r\nwith a rag soaked in pitch and some other\r\nflammable material wrapped\r\naround one end.\r\n', 'REUSABLE by simply refilling their metal canisters\r\nwith fuel like paraffin, citronella or other lamp oil, \r\nand very simple to maintain, simply remove \r\nany fuel left over and store in a dry place \r\nfor your next event.', 'Simply push the torch\r\nin the ground at the required place.\r\nBy unscrewing the cap, you are able to fill the canister\r\nwith either Oil or Paraffin. Simply then light the wick.\r\nThe lanterns should burn for approximately 8 hours.\r\nThese are not a toy, and children should\r\nkeep away from naked flames\r\nPerfect for:\r\nGarden\r\nWedding\r\nBeaches\r\nBBQ party\r\nDecoration in parks\r\nand more!', '', '', 'wedding&parties', 'accessories', 1),
