(220, 'Anti Mosquito Deet Free Repellent Citronella Waterproof Silicone Wristband Ankle.jpg', 'Anti Mosquito Deet Free Repellent Citronella Waterproof Silicone Wristband Ankle', '0.99', '2.99', '1x, 2x, 3x, 4x, 5x, 10x ', '', 'yellow, red, green, blue, black', '', 'The wrist band is perfect for both indoor and outdoor activities such as:\r\njogging\r\ncamping\r\nfishing\r\npicnic\r\nhunting\r\n as well as other outdoor places\r\nIt can be worn as a mosquito repellent protection on wrist or ankle\r\nPuncture any of the five holes on the top part of the wrist band for desired level of fragrance\r\n', 'For external use only, do not swallow\r\nFollow and read label instructions before use\r\nIn case of allergic reactions, cease use immediately\r\nIn event of accidental contact of citronella oil with mouth or eyes, rinse thoroughly.\r\nThe wrist band is manufactured with silicone with a natural essence of citronella oil to be effective against mosquitoes and bug\r\n>Outdoor and indoor use<\r\n>Citronella oil extract<\r\n>Adjustable control of level of fragrance<\r\n>Effective 4-6 weeks<\r\nStore in a safe place. Store and keep in a cool and dry place', '', '', '', '', '', '', 0),
