(229, 'Unisex Polarized Lens Clip On Flip up Sunglasses Car Driving Sport Specs Shades.jpg', 'Unisex Polarized Lens Clip On Flip up Sunglasses Car Driving Sport Specs Shades', '3.99', '9.00', '', '', '', 'small, large', '', 'With this polarized clip on sunglasses one will be able to simply place on the shaded lens over their regular glasses and keep going.\r\n\r\nDeep clip. Polarized. Anti-glare. Lightweight.\r\nClip On Sunglasses are the perfect combination of function and style to meet the demands of an active person.\r\n\r\nPeople need eye protection in all seasons, for all kinds of activities:\r\nwalking\r\nboating\r\nskiing\r\noutdoor activities\r\nsporting events of all kindsthe list goes on and on.Polarization is good for driving especially late in the evening when the shadows obscure things. \r\nEven on a cloudy day or in the dead of winter, \r\nlight reflects off water, snow, roads and glass surfaces causing glare and the need for sunglasses. \r\nGreat for any season, either winter or summer.\r\nCan be easily place on, when you need them and slip them off when you no longer need the shades.\r\nYou wont have to worry about keeping track of two pairs of glasses and they can always have them on hand. \r\nThey are not noticeable, ', '\r\nPeople need eye protection in all seasons, for all kinds of activities:\r\nwalking\r\nboating\r\nskiing\r\noutdoor activities\r\nsporting events of all kindsthe list goes on and on.\r\n1 x Clip on Sunglasses', '', '', '', 'stockclearance', 'deals', 2);
